import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardHeader from '@material-ui/core/CardHeader';
import CardContent from '@material-ui/core/CardContent';
import Typography from '@material-ui/core/Typography';
import Divider from '@material-ui/core/Divider';

const seriesStyles = makeStyles((theme) => ({
	card: {
		minWidth: 250
	}
}));

const dividerStyles = makeStyles((theme) => ({
	divider: {
		margin: '10 0',
		backgroundColor: theme.palette.primary.main
	}
}));

const SeriesDetails = (props) => {
	const seriesClasses = seriesStyles();
	const dividerClasses = dividerStyles();

	return (
		<Card className={seriesClasses.card}>
			<CardContent>
				<Typography variant='h6' component='h2'>
					{props.seriesDetails.name}
				</Typography>
				<Divider className={dividerStyles.divider} />
				<Typography variant='body2' component='p'>
					well meaning and kindly.
				</Typography>
			</CardContent>
		</Card>
	);
};

export default SeriesDetails;
